Johnny and Brynn just got married and are about to consummate their marriage, but Johnny is in a drunken stupor. He goes to the washroom to freshen up, but ends up passing out. Brynn tries to salvage her wedding night by ordering champagne. When The room service arrives, Brynn finds just the right Bell Hop to consummate her marriage with.
